package cn.com.phinfo.protocol;import java.util.List;import java.util.Stack;import com.heqifuhou.protocolbase.HttpResultBeanBase;import com.heqifuhou.protocolbase.QuickRunObjectBase;public class AttendrptRun extends QuickRunObjectBase {	public AttendrptRun(final String AttendYear,final String AttendMonth,final String userId) {		super(LURLInterface.GETattendrpt_serarch(AttendYear,AttendMonth,userId),null,AttendrptResultBean.class);	}	public static class AttendrptResultBean extends HttpResultBeanBase{		private List<AttendItem> listData = new Stack<AttendItem>();		public List<AttendItem> getListData() {			return listData;		}		public void setListData(List<AttendItem> listData) {			this.listData = listData;		}	}		public static class AttendItem{		private String Attend;		private String fieldName;		private List<String> days = new Stack<String>();		public String getAttend() {			return Attend;		}		public void setAttend(String attend) {			Attend = attend;		}		public String getFieldName() {			return fieldName;		}		public void setFieldName(String fieldName) {			this.fieldName = fieldName;		}		public List<String> getDays() {			return days;		}		public void setDays(List<String> days) {			this.days = days;		}	}		}